import React, { Component } from "react";

class Legende extends Component {
  state = {
    visible: true
  };

  hideLegende = () => {
    this.setState({
      visible: false
    });
  };

  render() {
    return (
      <div
        id='legende'
        style={{ display: this.state.visible ? "block" : "none" }}
      >
        <button
          onClick={this.hideLegende}
          style={{ display: this.state.visible ? "block" : "none" }}
        >
          Click
        </button>
      </div>
    );
  }
}

export default Legende;
